import React from 'react';
import MainPage from '../src/components/MainPage'
import {BrowserRouter as Router, Routes,Route} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path='/home' element={<MainPage/>}/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
